### Describe the issue

Hi, I'm evaluating libraries on `gemm` and hope it could perform well from fp32 to fp16, it seems `Mlas` is a good choice, so I use the [faiss](https://github.com/facebookresearch/faiss) library to perform the comparison, for simplicity, I only choose the IndexFlat as the comparison algorithm which is just a matrix multiplication using L2 distance. I replace the [sgemm_](https://github.com/facebookresearch/faiss/blob/main/faiss/utils/distances.cpp) with the [MlasGemm] from `Mlas`.
The benchmark is performed using [sift1m](http://corpus-texmex.irisa.fr/) vector, and my environment is AMD Ryzen 7 5800H CPU with manjaro Linux. 
The performance of `Mlas` is around half of `OpenBlas` which is default adoption of `faiss` library.

Do we have roadmap on performance improvement of `Mlas`?

